（上一个回复有错我也不改了，太 长 了）

不如曲线救国，在给玩家的时候就给带了特定 NBT 的方块。我不知道你是如何让玩家获取到木板的，但无外乎战利品表、命令方块、掉落物三种。其中前两者都可以指定 NBT，第三者其实也可以改。方法如下：
scoreboard players tag @e[type=minecraft:item] add foo {Item:{id:"minecraft:planks"}}
scoreboard players tag @e[type=minecraft:item] remove foo {Item:{id:"minecraft:planks",tag:{CanPlaceOn:["minecraft:stone"]}}}
entitydata @e[tag=foo] {Item:{tag:{CanPlaceOn:["minecraft:stone"]}}}
scoreboard players tag @e remove foo

如果你本身设想就是玩家一开始拿到普通木板，之后触发某条件再加 NBT，你可以在最初给普通木板的时候加一个自定义标签，例如
give @p minecraft:planks 1 0 {isNormal:1b}
在后续处理的时候检测以及 clear 带有 {isNormal:1b} 的木板来避免你在备注中提到的问题。

